using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using InnovationPortalService.Utils;

namespace InnovationPortalServiceTests.Utils
{
    [TestClass]
    [System.Diagnostics.CodeAnalysis.ExcludeFromCodeCoverage]
    public class FileValidatorTests
    {
        const string ValidTxtFileData   = @"SGVsbG8gV29ybGQh";

        const string ValidJpgFileData   = @"";

        const string ValidPdfFileData   = @"";

        const string ValidDocFileData   = @"";
        const string ValidDocxFileData  = @"";

        const string InvalidFileData    = @"";

        [TestMethod]
        public void TestGetFileType_CalledWithSupportedMimeType_ShouldReturnValidTypeEnum()
        {
            FileValidator.FileType fileType = FileValidator.GetFileType("application/pdf");
            Assert.AreEqual(FileValidator.FileType.Pdf, fileType, "Invalid file type returned");
        }

        [TestMethod]
        public void TestGetFileType_CalledWithUnsupportedMimeType_ShouldReturnNoneTypeEnum()
        {
            FileValidator.FileType fileType = FileValidator.GetFileType("application/bmp");
            Assert.AreEqual(FileValidator.FileType.None, fileType, "Invalid file type returned");
        }

        [TestMethod]
        public void TestTextFileValidator_ExtensionAndContentValidation_ShouldPassAllCoveredScenarios()
        {
            bool status;
            IFileValidator fileValidator = FileValidator.GetInstance(FileValidator.FileType.Txt);

            // Test valid file extension
            status = fileValidator.IsValidFileExtension("test.txt");
            Assert.IsTrue(status, "Invalid file extension validation status returned");

            // Test invalid file extension
            status = fileValidator.IsValidFileExtension("test.abc");
            Assert.IsFalse(status, "Invalid file extension validation status returned");

            // Test valid file content
            status = fileValidator.IsValidFileContent(ValidTxtFileData);
            Assert.IsTrue(status, "Invalid file content validation status returned");

            // Test invalid file content
            status = fileValidator.IsValidFileContent(InvalidFileData);
            Assert.IsTrue(status, "Invalid file content validation status returned");
        }

        [TestMethod]
        public void TestImageFileValidator_ExtensionAndContentValidation_ShouldPassAllCoveredScenarios()
        {
            bool status;
            IFileValidator fileValidator = FileValidator.GetInstance(FileValidator.FileType.Img);

            // Test valid file extension
            status = fileValidator.IsValidFileExtension("test.jpg");
            Assert.IsTrue(status, "Invalid file extension validation status returned");
            status = fileValidator.IsValidFileExtension("test.jpeg");
            Assert.IsTrue(status, "Invalid file extension validation status returned");

            // Test invalid file extension
            status = fileValidator.IsValidFileExtension("test.abc");
            Assert.IsFalse(status, "Invalid file extension validation status returned");

            // Test valid file content
            status = fileValidator.IsValidFileContent(ValidJpgFileData);
            Assert.IsTrue(status, "Invalid file content validation status returned");

            // Test invalid file content
            status = fileValidator.IsValidFileContent(InvalidFileData);
            Assert.IsFalse(status, "Invalid file content validation status returned");
        }

        [TestMethod]
        public void TestPdfFileValidator_ExtensionAndContentValidation_ShouldPassAllCoveredScenarios()
        {
            bool status;
            IFileValidator fileValidator = FileValidator.GetInstance(FileValidator.FileType.Pdf);

            // Test valid file extension
            status = fileValidator.IsValidFileExtension("test.pdf");
            Assert.IsTrue(status, "Invalid file extension validation status returned");

            // Test invalid file extension
            status = fileValidator.IsValidFileExtension("test.abc");
            Assert.IsFalse(status, "Invalid file extension validation status returned");

            // Test valid file content
            status = fileValidator.IsValidFileContent(ValidPdfFileData);
            Assert.IsTrue(status, "Invalid file content validation status returned");

            // Test invalid file content
            status = fileValidator.IsValidFileContent(InvalidFileData);
            Assert.IsFalse(status, "Invalid file content validation status returned");
        }

        [TestMethod]
        public void TestWordFileValidator_ExtensionAndContentValidation_ShouldPassAllCoveredScenarios()
        {
            bool status;
            IFileValidator fileValidator = FileValidator.GetInstance(FileValidator.FileType.Word);

            // Test valid file extension
            status = fileValidator.IsValidFileExtension("test.doc");
            Assert.IsTrue(status, "Invalid file extension validation status returned");
            status = fileValidator.IsValidFileExtension("test.docx");
            Assert.IsTrue(status, "Invalid file extension validation status returned");

            // Test invalid file extension
            status = fileValidator.IsValidFileExtension("test.abc");
            Assert.IsFalse(status, "Invalid file extension validation status returned");

            // Test valid file content
            status = fileValidator.IsValidFileContent(ValidDocFileData);
            Assert.IsTrue(status, "Invalid file content validation status returned");
            status = fileValidator.IsValidFileContent(ValidDocxFileData);
            Assert.IsTrue(status, "Invalid file content validation status returned");

            // Test invalid file content
            status = fileValidator.IsValidFileContent(InvalidFileData);
            Assert.IsFalse(status, "Invalid file content validation status returned");
        }
    }
}
